import {Card} from "./styles";
function CardDisplay({ id,name,brand,price,rating}:any) {

    return (
      
      <Card>
        
        <h2 className="title">{id}</h2>
        <p className="quote">{name}</p>
        <p>{brand}</p>
        <p>{price}</p>
        <p>{rating}</p>
      </Card>
    );
  }
  export default CardDisplay;
